import React from "react";
import AddEntity from "../pages/AddEntity.js";

const AddPublisher = () => {
  const fields = [
    { name: "legalname", label: "Юридическое название", type: "text", required: true },
    { name: "contactnum", label: "Контактный номер", type: "text", required: true },
    { name: "email", label: "Email", type: "email", required: true },
    {
      name: "address_id",
      label: "Адрес",
      type: "select",
      required: true,
      source: "/addresses", // эндпоинт для получения списка адресов
      getLabel: (opt) => `${opt.city}, ${opt.street} ${opt.building || ""}`,
    },
  ];

  return (
    <AddEntity
      title="Добавить издателя"
      description="Введите данные нового издателя"
      apiPath="/publishers"
      fields={fields}
    />
  );
};

export default AddPublisher;
